import React, { Component } from "react";
import YAML from 'yaml';

class Konumlar extends Component {
  state = {
    konumlar: [],
  };

  componentDidMount() {
    this.loadKonumlar();
  }

  loadKonumlar() {
    fetch('konumlar.yaml')
      .then((response) => response.text())
      .then((data) => {
        const konumlar = YAML.parse(data);
        this.setState({ konumlar });
      })
      .catch((error) => {
        console.error('Dosya okunurken bir hata oluştu:', error);
      });
  }

  render() {
    const { konumlar } = this.state;

    return (
      <div>
        <h3>Konumlar:</h3>
        {konumlar.map((konum, index) => (
          <div key={index}>{konum}</div>
        ))}
      </div>
    );
  }
}

export default Konumlar;
